import React, { useState } from 'react';
import { registerUser, updateUserStep } from './api';
import './App.css';

function App() {
  const [currentStep, setCurrentStep] = useState(1);
  const [userId, setUserId] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  // Handle Step 1 form submission
  const handleStep1Submit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    const formData = new FormData(e.target);
    const userData = {
      email: formData.get('email'),
      password: formData.get('password')
    };

    try {
      const response = await registerUser(userData);
      setUserId(response.id);
      setCurrentStep(2);
      alert(`âœ… Registration successful! User ID: ${response.id}`);
    } catch (error) {
      setError('Registration failed. Email might already exist.');
      console.error('Registration error:', error);
    } finally {
      setLoading(false);
    }
  };

  // Handle Step 2/3 navigation
  const handleNextStep = async () => {
    if (currentStep === 2) {
      setCurrentStep(3);
    } else if (currentStep === 3) {
      alert('ðŸŽ‰ Registration Complete! Check the data table to see your info.');
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>ðŸŽ¯ Zealthy Onboarding</h1>

        {/* Progress Bar */}
        <div className="progress-bar">
          <div className={`step ${currentStep >= 1 ? 'active' : ''}`}>1</div>
          <div className={`step ${currentStep >= 2 ? 'active' : ''}`}>2</div>
          <div className={`step ${currentStep >= 3 ? 'active' : ''}`}>3</div>
        </div>

        {/* Error Message */}
        {error && <div className="error">{error}</div>}

        {/* Step 1: Email/Password */}
        {currentStep === 1 && (
          <div className="step-content">
            <h2>Step 1: Create Account</h2>
            <form className="onboarding-form" onSubmit={handleStep1Submit}>
              <input 
                type="email" 
                name="email"
                placeholder="Email" 
                required 
              />
              <input 
                type="password" 
                name="password"
                placeholder="Password (min 6 characters)" 
                minLength="6"
                required 
              />
              <button type="submit" disabled={loading}>
                {loading ? 'Creating Account...' : 'Next Step â†’'}
              </button>
            </form>
          </div>
        )}

        {/* Step 2: Dynamic Components */}
        {currentStep === 2 && (
          <div className="step-content">
            <h2>Step 2: Tell Us About Yourself</h2>
            <p>âœ¨ Dynamic components will appear here based on admin configuration</p>
            <p><strong>User ID:</strong> {userId}</p>
            <button onClick={handleNextStep}>Next Step â†’</button>
          </div>
        )}

        {/* Step 3: Final Step */}
        {currentStep === 3 && (
          <div className="step-content">
            <h2>Step 3: Almost Done!</h2>
            <p>ðŸŽ¯ More dynamic components here</p>
            <p><strong>User ID:</strong> {userId}</p>
            <button onClick={handleNextStep}>Complete Registration</button>
          </div>
        )}

        {/* Navigation */}
        <div className="navigation">
          <nav>
            <a href="/admin">Admin Dashboard</a> | 
            <a href="/data">View Data</a>
          </nav>
        </div>
      </header>
    </div>
  );
}

export default App;
